import React from 'react';
import List from '@material-ui/core/List';
import {
  Inbox,
  Assignment,
  Done,
} from '@material-ui/icons';

import FilterLink from '../constants/FilterLink';
import { ActionTypes } from '../constants/ActionTypes';

const FilterList = () => (
  <List>
    <FilterLink filter={ActionTypes.SHOW_ALL} icon={<Inbox />}>
      All
    </FilterLink>
    <FilterLink filter={ActionTypes.SHOW_INPROGRESS} icon={<Assignment />}>
    IN PROGRESS    
    </FilterLink>
    <FilterLink filter={ActionTypes.SHOW_TODO} icon={<Assignment />}>
    TODO 
    </FilterLink>
    <FilterLink filter={ActionTypes.SHOW_DONE} icon={<Done />}>
      Done
    </FilterLink>
  </List>
);

export default FilterList;
